void GammaCorrectiom(const unsigned char *src, int len, unsigned char *Dst, int num = 0)
{
	int iCols;
	//BuildTable(1 / fGamma);//gamma校正查找表初始化
	//对图像的每个像素进行查找表矫正
	if (num == 0)//U
	{
		for (iCols = 0; iCols<len; iCols++)
		{
			Dst[iCols] = g_GammaTable_U[src[iCols]];
		}
	}
	else//V
	{
		for (iCols = 0; iCols<len; iCols++)
		{
			Dst[iCols] = g_GammaTable_V[src[iCols]];
		}
	}


}
void LumaGammaCorrectiom(const unsigned char *src, int len, unsigned char *Dst)
{

	//对图像的每个像素进行查找表矫正
	for (int i = 0; i<len; i++)
	{
		if (src[i] < 50 && src[i] >= 0)
		{
			Dst[i] = g_GammaLumaTable0[src[i]];
			
		}
		else if (src[i] >= 50 && src[i] < 100)
		{
			Dst[i] = g_GammaLumaTable1[src[i]] - 5;
			
		}
		else if (src[i] >= 100 && src[i] < 150)
		{
			Dst[i] = g_GammaLumaTable2[src[i]];
			
		}
		else if (src[i] >= 150 && src[i] < 200)
		{
			Dst[i] = g_GammaLumaTable3[src[i]] + 2;
		}
		else if (src[i] >= 200 && src[i] < 250)
		{
			Dst[i] = g_GammaLumaTable4[src[i]];
		}
	}

}

int color_enhance(const unsigned char* pYuvSrc, int ywidth, int yheight, unsigned char *&pYuvDst)
{
	if (pYuvSrc == NULL)
		return IN_ERROR;
	if (ywidth <= 0 || ywidth <= 0)
		return INP_ERROR;
	if (pYuvDst == NULL)
		return OUT_ERROR;

	
	memcpy(pYuvDst, pYuvSrc, ywidth * yheight * 3 / 2 * sizeof(unsigned char));

	const unsigned char* pYSrc = pYuvSrc;
	const unsigned char* pUSrc = pYuvSrc + ywidth * yheight;
	const unsigned char* pVSrc = pYuvSrc + ywidth * yheight + (ywidth * yheight) / 4;

	unsigned char* pYDst = pYuvDst;
	unsigned char* pUDst = pYuvDst + ywidth * yheight;
	unsigned char* pVDst = pYuvDst + ywidth * yheight + (ywidth * yheight) / 4;

	LumaGammaCorrectiom(pYSrc, ywidth * yheight, pYDst);
	GammaCorrectiom(pUSrc, ywidth * yheight / 4, pUDst, 0);
	GammaCorrectiom(pVDst, ywidth * yheight / 4, pVDst, 1);

	for (int i = 0; i < ((ywidth * yheight + 1) / 4); i++)
	{
		//yellow
		if (g_yellowTable[pUSrc[i]][pVSrc[i]] == 1)
		{
			pUDst[i] -= 15;
			pVDst[i] -= 8;
			continue;
		}
		//red
		if (g_redTable[pUSrc[i]][pVSrc[i]] == 1)
		{
			pUDst[i] -= 8;
			pVDst[i] += 15;
			continue;

		}
		//green
		if(g_greenTable[pUSrc[i]][pVSrc[i]] == 1)
		{
			pUDst[i] -= 9;
			pVDst[i] -= 16;
			continue;

		}
		//blue
		if(g_blueTable[pUSrc[i]][pVSrc[i]] == 1)
		{
			pUDst[i] += 15;
			pVDst[i] -= 5;
			continue;

		}
		//hair
		if (g_hairTable[pUSrc[i]][pVSrc[i]] == 1)
		{
			pUDst[i] -= 2;
			pVDst[i] -= 2;
			continue;

		}
		//face
		if (g_faceTable[pUSrc[i]][pVSrc[i]] == 1)
		{
			pUDst[i] += 3;
			pVDst[i] -= 6;
			continue;

		}
		//white
		if (g_whiteTable[pUSrc[i]][pVSrc[i]] == 1)
		{
			pUDst[i] += 2;
			pVDst[i] -= 2;
			continue;

		}

	}

	return CE_SUCCESS;
}

int main()
{
	ifstream fin;
	fin.open("lxq_420.yuv", ios_base::in | ios_base::binary);
	if (fin.fail())
	{
		cout << "the file is error" << endl;
		return -1;
	}

	fin.seekg(0, ios::end);
	streampos ps = fin.tellg();
	unsigned long NumberPixe = ps;
	cout << "file size: " << ps << endl;
	unsigned FrameCount = ps / framesize;
	cout << "frameNuber: " << FrameCount;
	fin.close();

	FILE* fileIn = fopen("lxq_420.yuv", "rb+");
	FILE* fileOut = fopen("D://lxq_420_new1.yuv", "wb+");

	unsigned char* pYuvBuf = new unsigned char[framesize];
	unsigned char* pYuvDst = new unsigned char[framesize];



	for (int i = 0; i < FrameCount; ++i)
	{
		fread(pYuvBuf, framesize * sizeof(unsigned char), 1, fileIn);

		color_enhance(pYuvBuf, width, height, pYuvDst);

		fwrite(pYuvDst, framesize * sizeof(unsigned char), 1, fileOut);
	}
	fclose(fileIn);
	fclose(fileOut);
	delete[]pYuvBuf;
	delete[]pYuvDst;

	return 0;
}